//fb.me/EmpiresAndPuzzles', Developer: 'Small Giant Games', Age_Rating: '12+', Size: 209278976, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/yellow-sq/id1117951211', Name: 'Yellow Sq', Subtitle: 'Not Subtitle', Icon_Url: 'https://is3-ssl.mzstatic.com/image/thumb/Purple128/v4/ef/54/36/ef54367e-9242-eb33-71b9-d826277a5ae0/source/512x512bb.jpg', Description: 'Swipe up, down, left, and right to slide around the screen. The bouncing balls reveal points, but they also mean game over if you hit one. Fortunately you can watch a short ad in the menu to get extra lives.  Avoid the bouncing balls while collecting as many points as you can!', Developer: 'Gurtz Design & Development LLC', Age_Rating: '4+', Size: 20921344, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/sharp-shooter-sniper-assassin-alone-contract-stealth/id1118044220', Name: 'Sharp shooter Sniper assassin \\u2013 The alone contract stealth killer at frontline', Subtitle: 'Not Subtitle', Icon_Url: 'https://is1-ssl.mzstatic.com/image/thumb/Purple20/v4/2b/c2/b1/2bc2b105-66b8-5414-d8a6-4d8636f4baa6/source/512x512bb.jpg', Description: '~ ~ ~ Sharp Shooter Sniper Assassin ~ ~ ~  Welcome to your new First-Person Shooter assignment.   FIRST-PERSON MISSIONS You are a special ops soldier ready to play your part in dangerous enemy territory.   When aiming, stop your breath to improve accuracy. Your job as sniper is to travel into enemy territory, climb up to the top of the building, locate and eliminate hidden terrorists.   Stare down your rifle scope, zoom in to find and identify the target. Take a breath...and pull the trigger to make the kill shot.   So let\\u2019s download it and enjoy..  Have fun\\u2026!', Developer: 'Usman Elahi', Age_Rating: '12+', Size: 106161152, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/bloons-td-6/id1118115766', Name: 'Bloons TD 6', Subtitle: 'Not Subtitle', Icon_Url: 'https://is3-ssl.mzstatic.com/image/thumb/Purple123/v4/8d/7c/2e/8d7c2efe-0fc0-d7c3-6a32-d231302e5ade/source/512x512bb.jpg', Description: 'Smash Hit Tower Defense Game The Bloons are back and better than ever! Get ready for a massive 3D tower defense game designed to give you hours and hours of the best strategy gaming available.  Craft your perfect defense from a combination of awesome monkey towers, upgrades, Heroes, and activated abilities, then pop every last Bloon that comes your way!\\xa0  BRILLIANT 3D BLOONS TD * Vibrant new monkey animations and upgrade skins * Intense visual effects\\xa0 * 35 original maps, some with 3D objects that can block line of sight  EPIC MONKEY TOWER UPGRADES * 19 powerful monkey towers, including 2 all new monkeys - Druid and Alchemist! * 3 upgrade paths - all monkey towers now have 3 amazing paths to choose between * Tier 5 upgrades - top upgrades so powerful only one monkey can have them  HEROES! * Each game, place one of these unique and powerful monkeys with 20 signature upgrades * Two bloon-shredding activated abilities per Hero * Craft new gameplay strategies around each Heros powers and synergies  DEEP MONKEY KNOWLEDGE SYSTEM * Over 100 meta-upgrades that buff individual monkey towers or monkey groups * Adds late game power so you can win more maps and reach higher freeplay rounds  MORE AWESOMENESS * Play anywhere - single player offline works even when your wifi doesnt! * New Bloons - tricky new bloon types like Purple, Fortified, and the relentless B.A.D. * New game modes added to each game difficulty, like Restricted Monkeys, Double Health MOABs, and the brutal CHIMPS rules * Widescreen support for iPhone X - fast access Powers menu available on iPhone X only!  And theres heaps more! We packed as much content and polish into this game as possible, and well continue to add new features, content, and challenges in regular updates. We truly respect your time and support, and we hope Bloons TD 6 will be the best strategy game youve ever played. If its not, please contact us at\\xa0support@ninjakiwi.com\\xa0and tell us what we can do better! Now those bloons arent going to pop themselves... sharpen your darts and go play Bloons TD 6!  ********** Best experienced on iPhone 8 or above, or on iPad 5th generation or above  Ninja Kiwi Notes:\\xa0 Please review our Terms of Service and Privacy Policy. You will be prompted in-game to accept these terms in order to cloud save and protect your game progress: https://ninjakiwi.com/terms https://ninjakiwi.com/privacy_policy  Bloons TD 6 contains in-game items can be purchased with real money. You can disable in-app purchases in your devices settings, or reach us at\\xa0support@ninjakiwi.com\\xa0for help. Your purchases fund our development updates and new games, and we sincerely appreciate every vote of confidence you give us with your purchases.\\xa0  Ninja Kiwi Community: We love hearing from our players, so please get in touch with any feedback, positive or negative, at\\xa0support@ninjakiwi.com. If its stuff you want the whole community to see and talk about, then join us on Facebook, Twitter, and Instagram: https://www.facebook.com/ninjakiwigames/ https://twitter.com/ninjakiwigames https://www.instagram.com/realninjakiwi/  Streamers and Video Creators: Ninja Kiwi is actively promoting channel creators on YouTube and Twitch. If you are not already working with us, keep making videos and tell us about your channel at\\xa0youtube@ninjakiwi.com.', Developer: 'Ninja Kiwi', Age_Rating: '9+', Size: 163898368, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/pocket-wars-protect-or-destroy/id1118130200', Name: 'Pocket Wars Protect or Destroy', Subtitle: 'Not Subtitle', Icon_Url: 'https://is4-ssl.mzstatic.com/image/thumb/Purple124/v4/c4/04/a1/c404a1cd-72d8-0afe-e10e-077789e1ef87/source/512x512bb.jpg', Description: 'You hold the Time Artifact. Will you use it for good or evil \\u2013 to Protect or Destroy?  --  Welcome to Pocket Wars!   Take control of your army and guide them to victory in this retro-style, turn based strategy board game.   Bring reinforcements and supplies to an ailing 13th Century Castle in Wales, Britain before the invading Uzgoth Horde can destroy it.  Help the employees of a mining station escape the invading elemental demons of Io. Or, maybe you prefer to be the Destroyer and bring vengeance to Hrethra and ensure that the LunarCol employees will never escape?   Pocket Wars is a 3D strategy board game designed for people who prefer a laid back \\u2018pick up and play\\u2019 style gaming experience, while also having a hands-on learning curve.   Remember those magazines where you cut out game pieces in order to play? Pocket Wars is like that: Easy to learn with specific scenario objectives, enough unique piece and behavior variation to keep things exciting, and with an easy-going pace of play.  Features: -\\tHigh resolution 3D turn-based strategy boardgaming -\\tPlay as a Protector and aid those in need, or become evil and play as a Destroyer -\\tVoice narrated tutorial teaches you the basics -      30+ Unique Combat Units with multiple special attacks -\\tComposed music and stereo ambient sound -      Save game option for all maps -\\tScenario One: The Battle for Snowdonia, a 13th century war set in medieval Wales, Great Britain -\\tScenario Two: The Mining Station, a science-fiction battle between Cyborgs and Elementals on the moon of Io -      Scenario Three: The Exclusion Zone. Modern Ukraine. Fend of the Corrupted and protect the nuclear facility.  Watch the trailer: https://youtu.be/cYMb_-SThOM  And read on to learn more about each scenario.  The Battle for Snowdonia  Castle Dinas Bran, in the remote environs of the Welsh mountains stands alone. The Uzgoth \\u2013 demons from another world \\u2013 will soon have the castle under siege. A minimal complement of men remain at the Castle, their grisly fate certain if reinforcements do not arrive soon.  The Wizard Morden, a stranger from another world, arrives to bring reinforcements and supplies for Castle Dinas Bran. Morden has faced the Uzgoth before, and their dreaded leader Khaaaz.   Take on the role of Protector and guide Morden and save Castle Dinas Bran. Or be a Destroyer and aide Khaaaz and the Uzgoth in their plan to dominate the Earth.   The Mining Station  In the future, Humanity has conquered the planets. They are mined for their rich minerals and other resources. On the Jupiter moon of Io, the mining company LunarCol has established a base \\u2013 beating the competition by many years.   The celebrations are short as the unwitting clone workers have awoken an ancient being. And now the demon Hrethra is bringing her rage upon the mining base and LunarCol must escape.   Escort and save the employees to the escape shuttle, or take on the role of Hrethra and ensure that your planet is never disturbed again by those wishing to steal and pillage its resources.   The choice is yours.  The Exclusion Zone  In April, 1986, an explosion at the Chernobyl Nuclear Plant in Ukraine results in the irradiation of a vast area surrounding the plant. It is the world\\u2019s worst nuclear accident. Twenty years later and the plant has been shutdown with only a routine staff of maintenance engineers and scientists now maintaining the facilities.   The unthinkable happens in 2012 when a massive earthquake occurs, with its epicenter in the center of the zone. A mysterious monolith has appeared, and now the corrupted come from everywhere: soldiers, ordinary people, veterans \\u2013 all intent on capturing the monolith for themselves.   Survive twelve turns while you are invaded from all sides to win this scenario.', Developer: 'Downsideup Games', Age_Rating: '9+', Size: 768564224, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/busy-airport/id1118219057', Name: 'Busy Airport', Subtitle: 'Not Subtitle', Icon_Url: 'https://is2-ssl.mzstatic.com/image/thumb/Purple20/v4/70/6d/f7/706df716-082d-c7f3-53c5-4b8fc1d2a6e1/source/512x512bb.jpg', Description: 'Keep your passengers happy and get them to their destination ASAP.  In Busy Airport we have 3 different Terminals to play with. The goal in this game is similar to all other airport games: We have to land the planes, send them to the terminal and let them start again.   No accidents may be caused while doing this!', Developer: 'fikret urgan', Age_Rating: '4+', Size: 6543360, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/gamehack-guide-for-game-of-war-fire-age/id1118257568', Name: 'GameHack: Guide for Game of War - Fire Age', Subtitle: 'Not Subtitle', Icon_Url: 'https://is4-ssl.mzstatic.com/image/thumb/Purple18/v4/7d/21/3f/7d213f9b-6c4b-2b7f-27cc-d6b279003cc1/source/512x512bb.jpg', Description: 'GameHack: Guide for Game of War - Fire Age is for you: - Tips to unlock T4 troops - All the stats of building (including alliance), troops and traps (regular and strategic) and research - Time to build, resource required, bonus, tips, Gems stats - Hero Skill tree and much more\\u2026 -  Fast trainer for beginner or expert player of GOW Free app, Test it !!!  Helpful wiki to plan your expansion of your empire. You can become an expert player and up level.  This guide is an unofficial guide of Game of War.  Following the tips of this guide your alliance will be stronger. This app is created by a team of expert players in GOW who want to share his knowledge. All the content of this app are generated by lovers of the best MMO.  Statistic and guide up to date with a continuous updated by an active expert fan team.  Wiki to accelerate the growing development of your alliance.  App needed for expert player or novice who wants to up his level fasterl!!!', Developer: 'Brian Tribble', Age_Rating: '4+', Size: 16115712, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/in-her-mind/id1118279998', Name: 'In Her Mind', Subtitle: 'Not Subtitle', Icon_Url: 'https://is2-ssl.mzstatic.com/image/thumb/Purple30/v4/bd/c1/b4/bdc1b427-e230-629f-c510-baa3e1501768/source/512x512bb.jpg', Description: 'This is a spectacular adventure game of the top-secret mission while your life is threatened by the mysterious organization.  - How to play There are many important keys for the story in the movie that proceeds automatically. Tap the screen to throw balls, and collect the pieces of the secret.  - Feature of the game  * Novel game system we never had before * Simple operation of just tapping the screen when you find a secret piece * Action scene full of tense * Startling multi-end scenario', Developer: 'MARCHENTERPRISE, LLC.', Age_Rating: '12+', Size: 86922240, Original_Release_Date: '2008-7-11', Current_Version_Release_Date: '2017-5-30' }, { Url_Game: 'https://apps.apple.com/us/app/space-ships-war-3d-battles-td/id1118295260', Name: 'Space Ships WAR: 3D Battles TD', Subtitle: 'Not Subtitle', Icon_Url: 'https://is2-ssl.mzstatic.com/image/thumb/Purple62/v4/5d/5e/22/5d5e2234-1610-d95a-7bf8-3aae5c5e1fea/source/512x512bb.jpg', Description: 'Their civilization was born billions of years ago. They were the wisest creatures in space, when dinosaurs inhabited our planet. Forerunners!  \\u25b6 Stunning 3D graphics which use power of your device by maximum \\u25b6 Unique mix of tower defence and 3D indie strategy game  \\u25b6 True Indie game which has being developed by one guy for more than one year \\u25b6 Hundreds of tactics and strategies to win \\u25b6 Many different upgradable space ships and more opportunities to build your unique strategy \\u25b6 Epic giant bosses which kill you with pleasure  \\u25b6 Massive 3D battles in space \\u25b